import React,{useEffect,useState} from 'react';
// import './Card.css'

function Card({ src, title, description, price }) {
    const [houses,setHouses] =useState()
    useEffect(()=>{
        fetch('http://localhost:3000/houses')
        .then(resp=>resp.json())
        .then(data => {
            setHouses(data)
            console.log(data)})
        },[])

    return (
        <div className='card'>
            {houses.map((type)=>{
                return <h2>{type.data.house_type}</h2>
            })}

        </div>
    )
}

export default Card











































